import './App.css';
import { Routes, Route, Link } from 'react-router-dom';

// 1. Importe sua nova página inicial
import HomePage from './pages/HomePage';

// --- Criei páginas de exemplo que você pode colocar em outros arquivos ---
function PatientPage() {
    return <h1 className="display-4 mb-4">Gerenciamento de Pacientes</h1>;
}

function AgendaPage() {
    return <h1 className="display-4 mb-4">Agenda da Clínica</h1>;
}

function DentistPage() {
    return <h1 className="display-4 mb-4">Profissionais da Clínica</h1>;
}
// --- Fim das páginas de exemplo ---


function App() {
    return (
        <div>
            {/* Navbar Principal - Alterei o nome para Odonto+ */}
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow-sm">
                <div className="container-fluid">
                    <Link className="navbar-brand fw-bold" to="/">
                        <i className="fas fa-tooth me-2"></i>
                        Odonto+
                    </Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#topNavbar"
                            aria-controls="topNavbar" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="topNavbar">
                        {/* Você pode adicionar mais links aqui, como "Sair" */}
                    </div>
                </div>
            </nav>

            {/* Navbar Secundária (Opções) */}
            <nav className="navbar navbar-expand-lg navbar-light bg-light border-bottom">
                <div className="container-fluid">
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav"
                            aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle sub-navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav">
                            <li className="nav-item">
                                <Link className="nav-link" to="/pacientes">Pacientes</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/agenda">Agenda</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/dentistas">Dentistas</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

            {/* Conteúdo Principal (onde as páginas mudam) */}
            <main className="container mt-4">
                {/* 2. Configure as rotas para usar seus novos componentes */}
                <Routes>
                    <Route path="/" element={<HomePage />} />
                    <Route path="/pacientes" element={<PatientPage />} />
                    <Route path="/agenda" element={<AgendaPage />} />
                    <Route path="/dentistas" element={<DentistPage />} />
                </Routes>
            </main>
        </div>
    );
}

export default App;
